import React from 'react';
import Layout from '../components/Layout/Layout';
import data from '../data/data.json';

type countryProps = {
    name: string,
    currency: string
    weather: string & number
}

const Components = () => {
    return (
        <Layout page="Components">
            {data.map((props) => (
                <li>{props.name}{props.currency}</li>
            ))}
        </Layout>
    )
};

export default Components;
